import React, { useEffect } from 'react'

const Home = () => {
    const fetchData = () => {
        fetch("http://localhost:5000/users")
        .then((res)=> { return res.json();})
        .then((data)=> {
            console.log(data);
        })
    }

    useEffect(() => {
        fetchData();
    }, []);
    
    return (
        <>
            <h1>Home page</h1>

        </>
    )
}

export default Home
